import React from "react";
import { BottomNavigation, BottomNavigationAction, List, ListItem } from "@material-ui/core";

import './footer.css';

import instagram_icon from '../../assets/img/icons/instagram_icon.webp';
const Footer = () => {
    const [value, setValue] = React.useState('recents');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (

        <>
            <BottomNavigation xs={12} value={value} onChange={handleChange} className={`footer`}>

                <BottomNavigationAction 
                    label='Github' 
                    value='github' 
                    icon={instagram_icon}
                />
                <BottomNavigationAction
                    label='Instagram'
                    value='instagram'
                    icon
                />
            
            </BottomNavigation>

                


        </>
    )
}

export default Footer;
